import React from "react";
import { View, Text } from "react-native";
import HeaderTabs from "../components/HeaderTabs";

function Home(params) {
  return (
    <View>
      <Text>Home</Text>
      <HeaderTabs></HeaderTabs>
    </View>
  );
}

export default Home;
